import React from "react";
import "./About.css";



function About() {

  return (
    <div className="About" >

          <div className='PageWrapper' style={{ paddingTop:160, paddingLeft:40, paddingRight:40, paddingBottom:120 , backgroundColor:'#f0f0f0'}}>

            <div className='TitleDiv'>
              <p className='Title'>
                We are <span className="Designer">Arthitech</span>. A<span className="Developer"> Multidisiplinary design studio</span> based in Istanbul. We are consist of experienced designers in the digital product
                industry. We design complex digital systems and solve complex design problems. Design for Everything you need.
              </p>

            </div>

           </div>


    </div>
  );
}

export default About;
